import React from 'react';

function CartItem({ item }) {
  return (
    <div>
      <h3><span>{item.name}</span> <span>{item.quantity}</span></h3>
      <p>Price: ${item.price.toFixed(2)}</p>
    </div>
  )
}

export default CartItem;
